import Moment from 'react-moment';
import './Header.css';

export class HeaderTitle extends Component {
  render() {
    return (
      <div>
        <h4 className="pr-3 d-inline">Lambda School</h4>
        <Moment parse="MM-DD-YYYY HH:mm">05-08-2019 12:59</Moment>
      </div>
    );
  }
}

export default HeaderTitle;
